import React from 'react';

function Work(props) {

    if(props.isLoading){
        return(
            <div className="container">
                <div className="row">
                    LOADING....
                </div>
            </div>
        );
    }
    else if(props.errmess){
        return(
            <div className="container">
                <div className="row">
                    {props.errmess}
                </div>
            </div>
        );
    }

    return(
        <div className="container">
            That is how we work
        </div>
    );
}

export default Work;
